import classes from "./Cart.module.css";

function Cart(props) {
  const cartList = props.CartItems.map((item) => <li>item.name</li>);
  const totalAmount = props.CartItems.forEach((element) => {
    totalAmount = totalAmount + element.price;
  });
  return (
    <div>
      <ul className={classes[cart - items]}>{cartList}</ul>
      <div className={classes.total}>
        <h2>Total Amount</h2>
        <div>totalAmount</div>
      </div>
      <div className={classes.actions}>
        <button>Close</button>
        <button className={classes.button}>Order</button>
      </div>
    </div>
  );
}

export default Cart;
